import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

import {Router} from 'react-router-dom'

ReactDOM.render(
  <React.StrictMode>
      <Router>
        <App />
      </Router>
  </React.StrictMode>,
  document.getElementById('root')
);
